import React from 'react';
import FavoriteItem from './FavoriteItem/FavoriteItem';


const favoriteItems = (props)=>(

    <div>
        {props.postsData.map(ctrl=>(
            <FavoriteItem 
                key={ctrl.username} 
                name={ctrl.username}
                image={ctrl.image}/>
        ))}
        
    </div>
);



export default favoriteItems;
